import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 13.1-1011 Articles of organization.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1011.md","filePath":"vacode/13.1-1011.md"}'),r={name:"vacode/13.1-1011.md"},o=a('<h1 id="§-13-1-1011-articles-of-organization" tabindex="-1">§ 13.1-1011 Articles of organization. <a class="header-anchor" href="#§-13-1-1011-articles-of-organization" aria-label="Permalink to &quot;§ 13.1-1011 Articles of organization.&quot;">​</a></h1><p>A. The articles of organization shall set forth:</p><ol><li><p>A name for the limited liability company that satisfies the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-1012/" target="_blank" rel="noreferrer">13.1-1012</a>;</p></li><li><p>The post office address, including the street and number, if any, of the limited liability company&#39;s initial registered office, the name of the city or county in which it is located, the name of its initial registered agent at that office, and that the agent is either (i) an individual who is a resident of Virginia and one of the following: a member or manager of the limited liability company, a member or manager of a limited liability company that is a member or manager of the limited liability company, an officer or director of a corporation that is a member or manager of the limited liability company, a general partner of a general or limited partnership that is a member or manager of the limited liability company, a trustee of a trust that is a member or manager of the limited liability company, or a member of the Virginia State Bar or (ii) a domestic or foreign stock or nonstock corporation, limited liability company or registered limited liability partnership authorized to transact business in the Commonwealth; and</p></li><li><p>The post office address, including the street and number, if any, of the principal office of the limited liability company, which may be the same as the registered office, but need not be within the Commonwealth.</p></li></ol><p>B. The articles of organization may set forth any other matter that under this chapter is permitted to be set forth in an operating agreement of a limited liability company.</p><p>C. The articles of organization need not set forth any of the powers enumerated in this chapter.</p><p>D. If the Commission finds that the articles of organization comply with the requirements of law and that all required fees have been paid, it shall issue a certificate of organization.</p><p>1991, c. 168; 1992, c. 574; 1993, c. 113; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0190" target="_blank" rel="noreferrer">190</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0162" target="_blank" rel="noreferrer">162</a>; 2001, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0517" target="_blank" rel="noreferrer">517</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0541" target="_blank" rel="noreferrer">541</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0314" target="_blank" rel="noreferrer">314</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0748" target="_blank" rel="noreferrer">748</a>; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0763" target="_blank" rel="noreferrer">763</a>.</p>',7),n=[o];function l(s,h,f,c,m,g){return i(),t("div",null,n)}const b=e(r,[["render",l]]);export{d as __pageData,b as default};
